DİZİ :

Bellekte aynı türden sıralanmış verilerin oluşturduğu yapıya dizi denir. Bir veya birden fazla boyutlu olabilir.
Dizi değişkenleri aynı tipte birçok veriyi bir arada tutmayı sağlar.

1- Tek boyutlu diziler...
2- Çok boyutlu diziler...
3- Karışık (düzensiz) diziler...

1- TEK BOYUTLU DİZİLER:
Diziler ile tek bir tanımlama yapılarak istenilen sayıda veri girişi sağlanabilir. Dizi elemanları
bir indis numarasına sahiptir. Indis numaraları varsayılan olarak sıfırdan başlar. Dizinin kaç
elemanlı olacağı dizinin tanımlandığı satırda veya daha sonra da belirtilebilir.
Ayrıca dizi tanımlaması yapıldığında dizinin eleman sayısı, kullanılacak eleman sayısından az ise
dizi yeniden boyutlandırılabilir. Dizi değişkenin eleman sayısını belirtmek için "new" metodu kullanılır.

    değişken_Tipi[] değişken_adı;
    değişken_adı = new değişken_Tipi[Eleman sayısı];

Örnek:

    int [] rakam;
    rakam = new int[5];

veya

    int [] rakam = new int [5]; (komut satırları tek satırda yazılarak tanımlama yapılmış olur.) 

Örnek;

    string [] isimler;
    string [] isimler = new string[10];

Örnek;

    string [] isimler;
    isimler = new string[4];


Dizilerin indisleri sıfırdan başlar. Örnekteki isimler dizisinin 3 tane String tipinden elemanı vardır.
Dizilerin elemanlarına ulaşmak için istenilen elemanın indisi verilmesi gerekmektedir.

    isimler [0] = "Ali";
    isimler [1] = "Kemal";
    isimler [2] = "İsmail";
    MessageBox.Show(isimler[2]); dizilere tek tek değer atanabileceği gibi, tanımlarken de başlangıç değerleri
    atanabilir.
    string [] isimler = {"Mehmet", "Kemal", "İsmail"};


ÖRNEK SORU :

    5 elemanlı dizi tanımlayarak butona tıklandığında, dizi elemanlarını InputBox'dan okutan ve bu elemanları
    liste kutusuna listeleyen program kodunu yazınız.

    private void button1_Click(object sender, EventArgs e)
        {
            byte i;
            int [] dizi1 = new int [5];
                {
                    for (i=0; i<5; i++)
                        dizi1[i] = Convert.ToInt32 ( Microsoft.VisualBasic.Interaction.InputBox("Yazılı Notunu Giriniz","Bilgi Girişi", "",10,10));
                    {
                        for (i=0; i<5; i++)
                            listBox1.Items.Add(dizi1[i]);
                    }
                }
         }

ÖRNEK SORU 2:

    Tek boyutlu 4 elemanlı dizi (ilk değerleri verilerek) tanımlayın.
    Program çalıştırılıp, ComboBox'dan seçim yapıldığı zaman dizi elemanlarını textBox1'de listeleyen program kodunu yazınız.




2- ÇOK BOYUTLU DİZİLER

Diziler tek boyutlı olduğu gibi, birkaç boyutlu diziler de tanımlanabilir. iki veya daha çok boyutlu bilgileri saklamak
için kullanılan dizi türleridir. tek boyutlu dizilerde olduğu gibi çok boyutlu dizilerde de ilk değer ataması yapılabilir.
çok boyutlu dizilerde işlem yapabilmek için genellikle iç içe döngü yapıları kullanılmaktadır.

değişken_tipi[,] değişken_aadı;
değişken_adı = new değişken_tipi[1.eleman_sayısı, 2.eleman_sayısı];

ÖRNEK:
int[,] dizi1;
dizi1= new int[2,2];

şeklinde tanımlama yapılır.

[,] şeklindeki bu gösterim dizinin iki boyutlu olduğunu belirtir. (,) virgül sayısı artıkça dizinin boyutu da artar.
